@gooner_gazette @UlsterGunner @nonewthing Then they expect good performances or the best players in the world. 

If half the energy spent on negativity was used to support the club, it would do wonders for the players. But no...agenda first, Arsenal later. 

Embarassing.

@PriteshGada6 @obez2012 Ramsey. 

Also its not fair to say that these youngsters are anything like those that came before. This is a different generation a different dynamic to the squad..

