MØ is good enough, with potential and youth. He has that creativity we've been lacking. The stability Arsenal offers will only make him better.

@Jack10Gooner @now_arsenaI We're in this "mess" 1) Kroenke is not a good owner. So we had to settle for stop-gap players just to try and seal huge problems on the field. 
2) we got greedy as a fanbase and kicked out Wenger because these plasters were failing. 

Arteta and Edu inherited a mess.

@iam_llorente @SalibaEra_ Martinelli came back from injury, clearly had not developed a good enough relationship with Tierney on the left and Laca was on fire. 
If you keep Saliba who do you drop from the squad? Can't drop any of the 8 HG players this incls Holding and Chambers. 
Matteo must apologise.

